import React, {Component} from "react";
import './Years.css';

class Years extends Component {
    render(){
        return(
            <div className="Years-Main">
                <div className="text-container">
                <h1>02+</h1>
                <h4>Years Experience {'\n'} in Field</h4>
                </div>
            </div>
        )
    }
}

export default Years;
